(2, 'Términos y Condiciones', 'terminos-y-condiciones', '<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0cm;text-align:center;\r\nline-height:25.5pt;mso-outline-level:2;background:#FAFAFA\"><span style=\"color: rgb(33, 33, 33); font-family: Arial, sans-serif; font-size: 10.5pt; text-align: justify; background-color: rgb(255, 255, 255);\">El acceso y uso de este sitio web\r\nse rige por los términos y condiciones descritos a continuación, así como por\r\nla legislación que se aplique en la República del Perú. En consecuencia, todas\r\nlas visitas y todos los contratos y transacciones que realice un cliente (en\r\nadelante “el usuario”), en este sitio, así como sus efectos jurídicos, quedarán\r\nregidos por estas reglas y sometidas a esa legislación. Los términos y\r\ncondiciones contenidos en este instrumento formarán parte de todos los actos y\r\ncontratos que se ejecuten o celebren mediante los sistemas de oferta y\r\ncomercialización comprendidos en este sitio Web, entre los usuarios de este\r\nsitio y MARKETDM S.A.C., a quien se le denominará en adelante \"DMODA\r\nMARKET\", según convenga al sentido del texto.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">A continuación, se exponen dichas\r\ncondiciones:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">1. Registro del usuario o cliente</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Será requisito necesario para la\r\nadquisición de productos y servicios ofrecidos en este sitio, la aceptación de\r\nestos Términos y Condiciones, así como el registro por parte del usuario. Se\r\nentenderán como conocidos y aceptados estos Términos y Condiciones por el sólo\r\nhecho del registro, en el que se incluirá una manifestación expresa del usuario\r\nsobre el conocimiento de las presentes condiciones de uso. Asimismo, para el\r\ncaso del registro telefónico, se entiende como aceptación de las presentes\r\ncondiciones el proporcionar los datos necesarios para el registro. El registro\r\nen&nbsp;<u>market.dmoda.pe</u>&nbsp;es gratuito.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Dmoda Market se reserva el\r\nderecho de actualizar y/o modificar los Términos y Condiciones que detallamos a\r\ncontinuación en cualquier momento, sin previo aviso. Por esta razón\r\nrecomendamos revisar los Términos y Condiciones antes de efectuar alguna\r\noperación.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Para registrarse, el usuario\r\ndeberá brindar un correo electrónico vigente, recibir un mensaje en\r\nsu bandeja de correo o generar una clave desde la plataforma. También podrá\r\ningresar por medio de su cuenta de Facebook. El usuario es responsable, en caso\r\nde compartir el dispositivo de acceso, de proteger sus claves y accesos frente\r\nal uso de terceros.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">2. Clave Secreta</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">El usuario asume totalmente la\r\nresponsabilidad por el mantenimiento de la confidencialidad de su clave secreta\r\nregistrada en este sitio web, así como el acceso mediante su usuario de\r\nFacebook, los cuales le permiten efectuar compras, solicitar servicios\r\ny obtener información. Dichas claves y accesos son de uso personal y su entrega\r\na terceros no involucra responsabilidad de DMODA MARKET o de sus relacionadas\r\nen caso de mala utilización.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">3. Derechos del usuario de este\r\nsitio</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">El usuario gozará de todos los\r\nderechos que le reconocen el código civil y la legislación aplicable sobre\r\nprotección al consumidor vigente en el territorio del Perú, además de los que\r\nse le otorgan en estos términos y condiciones. El usuario dispondrá en todo\r\nmomento de los derechos de información y rectificación de los datos personales.\r\nLa sola visita de este sitio en el cual se ofrecen bienes y servicios, no\r\nimpone al consumidor obligación alguna, a menos que haya aceptado las\r\ncondiciones ofrecidas por la empresa, en la forma indicada en estos términos y\r\ncondiciones.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Del mismo modo, el usuario deberá\r\ntener en consideración los alcances del conjunto de normas decretadas en el\r\nmarco del Estado de Emergencia y la respectiva vigencia en su aplicación.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">4. Procedimiento para hacer uso\r\nde este sitio internet</span></b><span lang=\"ES\" style=\"font-size:10.5pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Para los productos ofrecidos por\r\nmedio de este sitio, DMODA MARKET informará, de manera inequívoca y fácilmente\r\naccesible, los pasos que deben seguirse para realizar su compra, e informará\r\nvía email cuando sea recibida la solicitud del pedido. Esta solicitud pasará\r\npor un proceso de validación de datos del usuario, medio de pago, la\r\nrecolección de productos del pedido en base al stock disponible al día del\r\ndespacho y luego se cerrará el pedido, emitiéndose el comprobante de pago, el\r\ncual será enviado al usuario junto con el despacho de su pedido, o le llegará\r\npor correo electrónico luego de facturado el pedido. DMODA MARKET indicará,\r\nademás, su dirección de correo postal o electrónico y los medios técnicos a\r\ndisposición del consumidor para identificar y corregir errores en el envío o en\r\nsus datos.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">5. Medios de pago que se podrán utilizar\r\nen este sitio</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Los productos y servicios\r\nofrecidos en este sitio, salvo que se señale una forma diferente para casos\r\nparticulares u ofertas de determinados bienes o servicios, sólo podrán ser\r\npagados bajo 3 modalidades:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">a. Pagos en línea utilizando\r\ntarjetas de crédito, débito o YAPE:</span></b><span lang=\"ES\" style=\"font-size:\r\n10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"> Aceptamos tarjetas\r\nde crédito Visa, MasterCard, American Express y Diners. Los montos aprobados\r\nserán retenidos o cobrados a la tarjeta utilizada al momento de la compra.\r\nLuego de la entrega del pedido, y en caso que la orden pudiera llegar\r\nincompleta por indisponibilidad de algún/os producto/s, se dará inicio al\r\nproceso de extorno por el monto diferencial, al medio de pago utilizado en la\r\ncompra, bajo los plazos establecidos por su entidad financiera. El pago con tarjeta\r\nbancaria de débito está sujeto a los Términos y Condiciones establecidos por la\r\nentidad bancaria emisora de la referida tarjeta.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">b. Pagos contra entrega:</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">\r\nJunto con el pedido se enviará el POS para procesar el pago.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">&nbsp;<b>c. Pagos en efectivo</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">Crédito/Débito:</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">\r\nTarjetas Visa, MasterCard, American Express, Diners<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">6. Formación del consentimiento en los pedidos\r\nrealizado a través de este sitio.</span></b><span lang=\"ES\" style=\"font-size:\r\n10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">A través de este sitio web, DMODA\r\nMARKET realizará ofertas de bienes y servicios, que podrán ser aceptadas por\r\nvía electrónica, utilizando los mecanismos que el sitio ofrece para ello. Toda\r\naceptación de oferta quedará sujeta a la condición que DMODA MARKET valide la\r\ntransacción. En consecuencia, para toda operación que se efectúe en este sitio,\r\nla confirmación y/o validación y/o verificación por parte de DMODA MARKET, será\r\nrequisito indispensable para la formación del consentimiento. Para dar por\r\nvalidada la transacción, una vez recibido el pedido, DMODA MARKET verificará:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\">a. Que dispone de los productos\r\nsolicitados en stock o, en caso de no disponer de algún producto, se\r\nconsiderará como sustituto solo aquellos que cumplan con el criterio\r\nseleccionado por el usuario, en función a las siguientes opciones:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 22.5pt 51pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">-\r\nMisma Marca: Producto similar bajo la misma marca/presentación.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 22.5pt 51pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">-\r\nA Criterio de DMODA MARKET (DMODA MARKET seleccionará productos tratando de\r\nmantener la relación calidad/precio de los productos originalmente elegidos por\r\nel usuario).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51.05pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">-\r\nNo sustituir el producto elegido<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51.05pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">b.\r\nQue el medio de pago ofrecido por el usuario es válido.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">c.\r\nQue los datos registrados por el usuario son auténticos y no media dolo ni/o\r\nerror.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">d.\r\nQue, cuando se trate de ofertas y/o promociones, el pedido respete las\r\ncondiciones detalladas en los legales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En atención a lo señalado en los párrafos anteriores,\r\ny como una medida de protección a la seguridad de las transacciones, DMODA\r\nMARKET podrá dejar sin efecto los pedidos cuando verifique que no se cumple uno\r\no más de los criterios establecidos en los literales a, b, c y d precedentes.\r\nEn estos casos, y como medida de seguridad para el usuario, DMODA MARKET\r\nanulará automáticamente el pedido, procediendo a comunicar este hecho a la\r\nentidad financiera emisora de la tarjeta utilizada por el usuario en su\r\nsolicitud de compra. Dicha entidad será la única responsable de proceder con la\r\nliberación del importe de acuerdo con sus procedimientos.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En el caso de venta de bebidas alcohólicas y cigarrillos,\r\nesta sólo se realizará a usuarios mayores de 18 años.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">7. Despacho de los productos</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los productos adquiridos a través&nbsp;<u>DMODA MARKET</u>&nbsp;estarán\r\nsujetos a las condiciones de entrega elegidas por el usuario y disponibles en\r\nel sitio web. La información del lugar de entrega es de exclusiva\r\nresponsabilidad del usuario. Los pedidos serán atendidos mediante rangos\r\nhorarios diarios definidos y de acuerdo con la disponibilidad publicada en el\r\nsitio web.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los plazos elegidos para el despacho y entrega se\r\ncuentan desde que DMODA MARKET haya validado la compra. Este plazo se cumplirá\r\nsiempre y cuando las condiciones de seguridad y acceso lo permitan, y cuando no\r\nse presente un caso fortuito o por motivo de fuerza mayor.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Es responsabilidad del usuario estar presente en la\r\ndirección de entrega, o designar al responsable para su recepción (en adelante\r\n“la persona responsable”). Durante el despacho, se debe revisar el pedido, al término\r\nse solicita su firma para dar conformidad del estado de los productos entregados\r\ny de la atención y se le hará entrega del comprobante de pago.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET esperará un máximo de 10 minutos luego de\r\nhaberse notificado al usuario la llegada del repartidor a su domicilio. Vencido\r\ndicho plazo, DMODA MARKET procederá con la anulación automática del pedido y el\r\ncobro respectivo por el valor total del pedido.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Durante campañas específicas y temporadas de alta\r\ndemanda como&nbsp;por ejemplo Cybers, Día de la Madre, Navidad (del 18 al 31 de\r\ndiciembre) y/o situaciones imprevisibles, caso fortuito o de fuerza mayor, DMODA\r\nMARKET realizará las entregas sin turno específico y podrá reprogramar los\r\nenvíos.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;background:yellow;\r\nmso-highlight:yellow;mso-ansi-language:ES;mso-fareast-language:RU\">El usuario\r\npodrá solicitar como máximo 15 productos por pedido o su equivalente de 26 kg\r\nen peso volumétrico.</span><span lang=\"ES\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Cobertura de Despacho a domicilio: Cercado, Cono Sur, Cono\r\nNorte.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">8. Cobro del servicio de envío (flete)</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">El cálculo del flete a cobrar se realiza en función a\r\nla distancia entre la dirección de entrega registrada y la tienda asignada para\r\nel despacho del pedido.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Si DMODA MARKET está en </span><span lang=\"ES-PE\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-fareast-language:RU\">campaña de Delivery\r\nGratis, el negocio asume el costo de envío.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">9. Anulaciones</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">&nbsp;Una vez generado el pedido, DMODA MARKET no\r\naceptará ninguna modificación o anulación del pedido.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">10. Política de cambios y devoluciones</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET acepta cambios y devoluciones de sus\r\nproductos por motivo de incumplimiento de entrega, producto en mal estado o\r\nvencido.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">El usuario o la persona responsable deberá gestionar\r\nel cambio o devolución enviando un correo a market@dmoda.pe dentro de las\r\nprimeras 48 horas de haber recibido el pedido, donde recibirá la información\r\nnecesaria para proceder con la devolución.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En el caso de devolución de productos en promoción, se\r\nrequiere la entrega de todos los productos incluidos en la promoción\r\ncorrespondiente.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Para la devolución de los pedidos con pago en línea, DMODA\r\nMARKET gestionará el extorno al mismo medio de pago utilizado por el usuario al\r\nrealizar la compra, luego de entregado o recogido el/los producto/s a ser\r\ndevuelto/s. El extorno del dinero se realizará bajo los plazos establecidos por\r\nsu entidad financiera.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En caso de devolución de los pedidos con&nbsp;Pago\r\nEfectivo, el monto pagado será reembolsado mediante un cheque emitido por DMODA\r\nMARKET a nombre del usuario luego de la fecha de entrega o recojo del/de los\r\nproducto/s a ser devuelto/s.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">11. Uso de los datos personales registrados en el\r\nsitio</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los datos referidos en estos términos y condiciones\r\ntendrán como finalidad validar los pedidos y mejorar la labor de información y\r\ncomercialización de los productos y servicios prestados por DMODA MARKET. Solo\r\npodrán ser entregados a las empresas filiales o relacionadas con MARKETDM\r\nS.A.C. En ningún caso serán traspasados a terceros. Asimismo, sugerimos a los\r\nusuarios revisar la “Política de Privacidad” de este sitio web para mayor\r\ninformación.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">12. Validez de las ofertas contenidas en este sitio</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los precios de los productos y servicios disponibles\r\nen este sitio, mientras aparezcan en él, solo tendrán vigencia y aplicación en\r\neste y no serán necesariamente aplicables a otros canales de venta utilizados\r\npor DMODA MARKET, salvo que se indique expresamente. Asimismo, DMODA MARKET\r\npodrá modificar cualquier información contenida en este sitio, incluyendo las\r\nrelacionadas con mercaderías, servicios, precios, existencias y condiciones en\r\ncualquier momento y sin previo aviso, respetando las compras que han sido\r\naceptadas hasta dicho momento, siempre sujeto a las condiciones de validación\r\nque se indican en el número 7.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-atta