ns-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Toda queja o reclamo, relacionada con actos o\r\ncontratos ejecutados o celebrados a través de esta web, deberá ser presentada a\r\nServicio al Cliente, enviando un corro a la siguiente dirección: market@dmoda.pe\r\no ingresando al&nbsp;<u>Libro de Reclamaciones Virtual</u>.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">16. Capacidad legal para contratar</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los servicios de&nbsp;<u>market.dmoda.pe</u>&nbsp;están\r\ndisponibles sólo para aquellos individuos que tengan capacidad legal para\r\ncontratar, según lo dispuesto por la legislación vigente. Si una persona no\r\ntiene capacidad legal para contratar, debe abstenerse de utilizar los servicios\r\nofrecidos en el sitio.&nbsp;<u>Market.dmoda.pe</u>&nbsp;podrá suspender la\r\nparticipación de usuarios que se compruebe carecen de capacidad legal para usar\r\nlos servicios ofrecidos en el sitio en cualquier momento en forma temporal o\r\ndefinitiva o cuando al registrarse brinden información que sea falsa, inexacta\r\no fraudulenta.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">17. Delimitación de responsabilidad</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><u><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Market.dmoda.pe</span></u><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">&nbsp;no\r\nse responsabiliza frente a los usuarios o terceros por los daños y perjuicios\r\nque sean consecuencia directa o indirecta de la interrupción, suspensión o\r\nfinalización de los servicios ofrecidos por el sitio web.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">18. Contenido fotográfico como referencia</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Las fotos de productos que aparecen en el sitio son\r\nreferenciales; pueden existir variantes entre la foto mostrada en&nbsp;<u>market.dmoda.pe</u>&nbsp;y\r\nel producto recibido. Para un mejor detalle, en la ficha o contenido de los\r\nproductos se podrá encontrar las características de los mismos. Ante la falta\r\nde correspondencia entre la fotografía y el producto, primará la información de\r\nlas características informadas del producto.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">19. Solución de conflictos: Arbitraje de Consumo</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Sin perjuicio del derecho al uso del Libro de\r\nReclamaciones, las partes acuerdan que toda controversia, reclamo o\r\ninconveniente, relacionada o derivada de este contrato o del producto/servicio\r\nque market.dmoda.pe ofrece en el mercado -incluida cualquier cuestión sobre su\r\nvalidez, cumplimiento o terminación, entre otros-, en el marco de una relación\r\nde consumo, serán resueltas de forma definitiva mediante el Arbitraje de\r\nConsumo, que es un proceso rápido y gratuito. El Usuario deberá presentar su\r\nsolicitud de arbitraje ante la Junta Arbitral de Consumo del Instituto Nacional\r\nde Defensa de la Competencia y de la Protección de la Propiedad Intelectual –\r\nINDECOPI o enviarla al correo&nbsp;</span><span lang=\"ES-PE\"><a href=\"mailto:arbitrajedeconsumo@indecopi.gob.pe\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#A81B8D;mso-ansi-language:ES;mso-fareast-language:RU\">arbitrajedeconsumo@indecopi.gob.pe.</span></a></span><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">El arbitraje será resuelto por un Tribunal Arbitral, a\r\ntravés de un laudo, de conformidad con el reglamento y las normas aplicables a\r\nla materia. El laudo es inapelable y definitivo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">20. Propiedad Intelectual</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Todas las marcas comerciales utilizadas en este sitio,\r\nincluyendo el diseño y gráfica de esta página, son de propiedad de DMODA MARKET\r\no pertenecen al propietario registrado de tales marcas, por lo que se reservan\r\nexpresamente todos los derechos de propiedad intelectual, de acuerdo a lo\r\nestipulado en la legislación peruana.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">21. Venta de Bebidas alcohólicas y cigarrillos</span></b><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Queda prohibida la venta de cigarrillos y de bebidas\r\nalcohólicas a menores de 18 años, acorde a la ley 28681 y la ley 28705.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">&nbsp;<b>22. Plazo de validez de las ofertas y precios</b><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 75pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">El plazo de validez de la oferta es aquel que coincide\r\ncon la fecha de vigencia indicada en la promoción o en virtud del agotamiento\r\nde las cantidades de productos disponibles para esa promoción debidamente informados\r\nal Usuario. Cuando quiera que en una promoción no se indique una fecha de\r\nterminación se entenderá que la actividad se extenderá hasta el agotamiento de\r\nlos inventarios correspondientes. Los precios de los productos y servicios\r\ndisponibles en este sitio web solo tendrán vigencia y aplicación en éste y no\r\nserán aplicables a otros canales de venta utilizados por las empresas\r\nofertantes, tales como, venta telefónica, otros sitios de venta por vía\r\nelectrónica, catálogos u otros. Los precios ofrecidos corresponden\r\nexclusivamente al valor del bien ofrecido y no incluyen gastos de transporte,\r\nmanejo, envío, accesorios que no se describan expresamente ni ningún otro ítem\r\nadicional o cobro de intereses bancarios por el método de pago utilizado. Las\r\nempresas ofertantes de los productos podrán modificar cualquier información\r\ncontenida en este sitio, incluyendo las relacionadas con mercaderías,\r\nservicios, precios, existencias y condiciones, en cualquier momento y sin\r\nprevio aviso. De existir un error tipográfico en alguno de los precios de los\r\nproductos, si el precio correcto del artículo es más alto que el que figura en\r\nla página, a nuestra discreción, DMODA MARKET lo contactará antes de que el\r\nproducto sea enviado para informarle este hecho a fin de que usted nos indique\r\nsi procedemos con el envío teniendo en cuenta una nueva compra con el precio\r\ncorrecto o si cancelamos su pedido de compra. En caso no tengamos respuesta por\r\nparte del cliente durante las primeras 24 horas, se procederá con la\r\ncancelación automática del pedido y el correspondiente extorno del monto\r\npagado. *Máximo 01 promoción por cliente y por pedido. *Máximo 01 pedido por\r\ncliente.<o:p></o:p></span></p>', NULL, NULL, NULL, NULL, 1, 1, 1, '2021-02-16 11:30:17', '2021-02-24 11:29:22', NULL);
INSERT INTO `services` (`id`, `name`, `slug`, `description`, `image`, `image_path`, `image_thumb`, `image_thumb_path`, `published`, `user_id`, `company_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(3, 'Políticas de Privacidad y Seguridad', 'politicas-de-privacidad-y-seguridad', '<p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">I. INTRODUCCIÓN</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">MKTDM S.A.C. tiene un firme compromiso por el respeto\r\ny el cumplimiento de todas las disposiciones legales y reglamentarias que les\r\nson aplicables. Asimismo, entiende que los datos personales, al ser parte\r\nintegrante de la privacidad de las personas; y al ser, también, fundamentales\r\npara nuestra actividad, deben ser tratados de tal forma que no sólo impliquen\r\nel cumplimiento del ordenamiento legal, sino que, además, se deben tomar\r\nmedidas que generen un ambiente de confianza y seguridad en el público respecto\r\na dicho tratamiento.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">II. OBJETIVO</span></b><span lang=\"ES\" style=\"font-size:\r\n10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">La presente Política tiene por objeto hacer de\r\nconocimiento del público nuestro compromiso con la protección de sus datos\r\npersonales, así como los lineamientos bajo los cuales realizamos el tratamiento\r\nde los mismos en ejercicio de nuestras actividades comerciales, la finalidad\r\npara la que lo hacemos, así como los procedimientos para que los titulares de\r\nlos mismos puedan ejercer los derechos de acceso, rectificación, cancelación,\r\nrevocación, información y oposición previstos en la Normativa de Protección de\r\nDatos Personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">III.&nbsp;ÁMBITO DE APLICACIÓN</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">La presente Política se aplica a toda actividad de\r\ntratamiento de datos personales realizada por parte de MKTDM S.A.C. (en\r\nadelante DMODA MARKET). Será también de aplicación para aquellas personas o\r\nempresas a las que DMODA MARKET requiera el tratamiento de datos personales de\r\nlos cuales sea responsable.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">IV.&nbsp;DEFINICIONES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En este capítulo se inserta el siguiente párrafo: Los\r\ntérminos que en esta política se usan con mayúscula se encuentran definidos en\r\nel Anexo N°1.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Las definiciones que sea necesario incorporar en el\r\ndocumento para una mejor comprensión del mismo, deben incluirse en el Anexo N°1\r\n(ver al final de este documento).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">V.&nbsp;PRINCIPALES RECTORES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET se compromete a respetar los principios\r\nrectores establecidos en la Normativa de Protección de Datos Personales. Estos\r\nson:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de\r\nlegalidad</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: El tratamiento de los datos personales se hace\r\nconforme a lo establecido en la ley, estando prohibida la recopilación de los\r\ndatos personales por medios fraudulentos, desleales o ilícitos.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de\r\nconsentimiento</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: Para el tratamiento de los\r\ndatos personales debe mediar el consentimiento de su titular, salvo que medie\r\nalguna de las excepciones previstas en la ley. Dicho consentimiento debe\r\ncumplir con los requisitos de ser libre, previo a su recopilación o\r\ntratamiento, expreso e inequívoco, e informado.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de\r\nfinalidad</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: Los datos personales deben ser recopilados para una finalidad\r\ndeterminada, explícita y lícita, y su tratamiento no debe extenderse a otra\r\nfinalidad distinta a aquella para la cual fueron recopilados.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de\r\nproporcionalidad</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: El tratamiento de datos\r\npersonales debe ser adecuado, relevante y no excesivo a la finalidad para la\r\nque estos hubiesen sido recopilados.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de calidad</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">:\r\nLos datos personales que vayan a ser tratados deben ser veraces, exactos y, en\r\nla medida de lo posible, actualizadas, necesarias, pertinentes y adecuadas\r\nrespecto de la finalidad para la que fueron recopilados.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">6.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de\r\nseguridad</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: El titular del banco de datos personales y el\r\nencargado de su tratamiento deben adoptar las medidas técnicas, organizativas y\r\nlegales necesarias para garantizar la seguridad de los datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">7.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de\r\ndisposición de recurso</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: El titular de datos\r\npersonales debe contar con las vías administrativas o jurisdiccionales\r\nnecesarias para reclamar y hacer valer sus derechos, cuando estos sean\r\nvulnerados por el tratamiento de sus datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">8.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Principio de nivel de\r\nprotección adecuado</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: Para el flujo transfronterizo\r\nde datos personales, se debe garantizar un nivel suficiente de protección para\r\nlos datos personales que se vayan a tratar o, por lo menos, equiparable a lo\r\nprevisto por la Ley de Protección de Datos Personales o por los estándares\r\ninternacionales en la materia.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">VI. FINALIDAD DEL TRATAMIENTO DE LOS DATOS PERSONALES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET realiza tratamiento de datos personales\r\nde colaboradores, postulantes, clientes y potenciales clientes, proveedores,\r\nvideo vigilancia, arrendadores, usuarios de nuestra página web y de todas\r\naquellas personas que visitan nuestras instalaciones y/o tienen alguna relación\r\njurídica o comercial con nuestra empresa, con la finalidad de cumplir con la\r\nlegislación vigente, ejecutar la relación jurídica que los titulares de los\r\ndatos personales mantengan con nuestra empresa, así como resguardar la\r\nseguridad de nuestros clientes y colaboradores.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">El tratamiento de datos personales para cualquier otra\r\nfinalidad lícita distinta a las antes mencionadas es debidamente informada a\r\nlos dichos titulares de datos personales, requiriéndoles una autorización\r\nespecífica, en cumplimiento del principio de consentimiento.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">&nbsp;VII. CONSENTIMIENTO</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET requerirá del consentimiento libre,\r\nprevio, expreso, inequívoco e informado del titular de los datos personales\r\npara el tratamiento de los mismos, salvo en los casos de excepción expresamente\r\nestablecidos por Ley.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET no requerirá consentimiento para tratar\r\nsus datos personales obtenidos de fuentes accesibles al público, gratuitas o no\r\npara el uso por el cual fueron hechos públicos; cuando sean necesarios para la\r\npreparación, celebración y ejecución de una relación contractual en la que el\r\ntitular de datos personal sea parte, cuando se hubiese aplicado un\r\nprocedimiento de anonimización o disocición, entre otras excepciones\r\nestablecidas en el artículo 14 del reglamento, así mismo, podrá tratar sus\r\ndatos personales o de fuentes no públicas, siempre que dichas fuentes cuenten\r\ncon su consentimiento para tratar y transferir dichos datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET le informa al usuario que los bancos de\r\ndatos cuya titularidad ostenta, se encuentran inscritos en el Registro de\r\nProtección de Datos de la Autoridad de Protección de Datos Personales. El\r\nUsuario otorga su consentimiento expresa para la inclusión de sus Datos\r\nPersonales en el Banco de Datos de titularidad de DMODA MARKET.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">VIII. DERECHOS DE LOS TITULARES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">De acuerdo con la Ley, los titulares de datos\r\npersonales tienen los siguientes derechos:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Derecho de Acceso e\r\ninformación</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: Como consecuencia del derecho de acceso, el titular\r\nde datos personales tiene derecho a obtener la información que sobre sí mismo\r\nsea objeto de tratamiento en bancos de datos de titularidad de </span><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">DMODA\r\nMARKET</span><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">. El derecho de información, por su parte, otorga al\r\ntitular el derecho de conocer la finalidad para la cual sus datos serán\r\ntratados, la existencia del banco de datos en que serán almacenados, la\r\nidentidad y domicilio del titular del banco de datos y de los encargados del\r\ntratamiento, si se producirá la transferencia de datos personales y a quienes,\r\nel tiempo de conservación, entre otros.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Derecho de\r\nrectificación, actualización e inclusión</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">:\r\nEl titular de datos personales tiene derecho a la actualización, inclusión y\r\nrectificación de sus datos personales materia de tratamiento por parte de </span><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">DMODA\r\nMARKET</span><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\"> cuando estos sean parcial o totalmente inexactos,\r\nincompletos o cuando se hubiere advertido omisión, error o falsedad.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Derecho de\r\nCancelación o Supresión</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">: El titular de datos\r\npersonales podrá solicitar la cancelación o supresión de sus datos personales\r\nno relacionados o necesarios para la ejecución de las obligaciones de cargo de </span><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\">DMODA\r\nMARKET</span><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\"> previstas en los contratos suscritos o las dispuestas\r\npor la normativa vigente.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">4.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Derecho de Oposición</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">:\r\nEl titular de datos personales puede oponerse al tratamiento de sus datos\r\npersonales en cualquier momento. La oposición procederá en la medida que el\r\ntratamiento no tenga justificación contractual o legal.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0cm 51pt; text-indent: -18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if !supportLists]--><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">5.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">Derecho de revocación</span></b><span lang=\"ES\" style=\"font-size: 10pt; font-family: Arial, sans-serif;\">:\r\nEl titular de datos personales puede retirar en cualquier momento el\r\nconsentimiento otorgado de manera previa. La revocación no alcanzará a los usos\r\ny/o tratamientos que puedan ejecutarse en los escenarios autorizados por la\r\nregulación.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">IX.&nbsp;PROCEDIMIENTO PARA EL EJERCICIO DE LOS\r\nDERECHOS DEL TITULAR DE LOS DATOS PERSONALES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los Titulares podrán revocar su consentimiento o\r\nejercer sus derechos de Ley, dirigiéndose al correo\r\nleyprotecciondatos@lindcorp.pe indicando su nombre completo y DNI.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En caso que el titular del dato personal requiera\r\nejercer sus derechos mediante un representante, éste deberá enviar una carta\r\npoder legalizada por notario público que lo faculte como tal y su documento de\r\nidentidad.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">X.&nbsp;PLAZO DEL TRATAMIENTO DE DATOS PERSONALES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Los datos personales tratados por DMODA MARKET serán\r\nalmacenados indeterminadamente, sin perjuicio de que el titular de los datos\r\npueda ejercer en cualquier momento los derechos mencionados en el numeral X de\r\nesta política.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\"><br>\r\n<b>XI.&nbsp;SEGURIDAD DE DATOS PERSONALES</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">En cumplimiento de la normativa vigente, DMODA MARKET\r\nadopta las medidas jurídicas, organizativas y técnicas apropiadas para\r\ngarantizar la seguridad de los datos personales, evitando su alteración,\r\npérdida, tratamiento indebido o acceso no autorizado.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Para este propósito, pone a disposición todos los\r\nrecursos humanos y tecnológicos necesarios, aplicándolos en proporción a la\r\nnaturaleza de los datos almacenados y los riesgos a los que se encuentran\r\nexpuestos.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET sólo realizará tratamiento sobre datos\r\npersonales que estén almacenados en repositorios que reúnan las condiciones de\r\nseguridad exigidas por la normativa vigente en protección de datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">&nbsp;<b>XII. TRANFERENCIA DE LOS DATOS PERSONALES</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">DMODA MARKET podrá transferir datos personales a\r\nentidades públicas legalmente facultadas dentro del ámbito de sus competencias,\r\nen cumplimiento de la normativa vigente, o por requerimientos de éstas o cuando\r\nmedie alguna de las excepciones previstas en la ley.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">A efectos de cumplir con las finalidades establecidas\r\nen la presente Política de Privacidad, DMODA MARKET contratará los servicios de\r\nOrion Peru SAC, empresa encargada de brindar el servicio de procesamiento y\r\nalmacenamiento ubicada en Estados Unidos. Como usted podrá advertir, el\r\nreferido proveedor se encuentra ubicado fuera del país, siendo que dicho\r\ntratamiento de datos personales se efectúa conforme a la normativa sobre\r\nprotección de datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">XIII.&nbsp;TRATAMIENTO DE LOS DATOS PERSONALES DE\r\nMENORES DE EDAD</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;\r\nmso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Al brindar sus datos personales a DMODA MARKET, el\r\nusuario declara tener al menos catorce años de edad o ser tutor de un menor de\r\nedad para otorgar el consentimiento de forma válida de acuerdo a la Ley. DMODA\r\nMARKET no llevará a cabo voluntariamente el tratamiento de Datos Personales\r\nrelativos a menores de edad, salvo que se cuente con el debido consentimiento\r\nde acuerdo a la norma aplicable. En el supuesto de que se tenga conocimiento\r\nque los Datos Personales recogidos corresponden a un menor de edad sin\r\nautorización de su tutor legal, se adoptarán las medidas oportunas para\r\neliminarlos.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">XIV. MODIFICACIONES</span></b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">De producirse cualquier cambio o modificación de la\r\npresente Política, el texto vigente de la misma será publicado en nuestro\r\nportal web: dmoda.market.pe en la sección Políticas de Privacidad.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Anexo N°1</span></b><span lang=\"ES\" style=\"font-size:\r\n10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#212121;mso-ansi-language:ES;mso-fareast-language:RU\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Definiciones<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">Las palabras y términos que se definen seguidamente,\r\ncuando ellos se escriban con mayúscula inicial según se hace en sus respectivas\r\ndefiniciones que siguen más adelante, fuere o no necesario conforme a las\r\nreglas ortográficas del uso de las mayúsculas, e independientemente del lugar\r\nde esta política en que se utilicen, o si se emplean en una persona, número,\r\nmodo, tiempo o variable gramatical, según sea necesario para el adecuado\r\nentendimiento de la misma, tendrán los significados que a cada una de dichas\r\npalabras o términos se les adscribe a continuación:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.1. Ley de Protección de Datos Personales. Ley 29733\r\ny sus modificatorias.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.2. Reglamento de la Ley de Protección de Datos\r\nPersonales. Decreto Supremo N° 003-2013-JUS y sus modificatorias.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.3. Banco de datos personales. Conjunto organizado de\r\ndatos personales, automatizado o no, independientemente del soporte, sea este\r\nfísico, magnético, digital, óptico u otros que se creen, cualquiera fuere la\r\nforma o modalidad de su creación, formación, almacenamiento, organización y\r\nacceso.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.4. Datos sensibles: Datos personales constituidos\r\npor los datos biométricos que por sí mismo pueden identificar al titular, datos\r\nreferidos al origen racial y étnico; ingresos económicos, opiniones o\r\nconvicciones políticas, religiosas, filosóficas o morales; afiliación sindical;\r\ne información relacionada a la salud o a la vida sexual.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.5. Titular de datos personales. Persona natural a\r\nquien corresponde los datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.6. Titular del banco de datos personales. Persona\r\nnatural, persona jurídica de derecho privado o entidad pública que determina la\r\nfinalidad y contenido del banco de datos personales, el tratamiento de estos y\r\nlas medidas de seguridad.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.7. Transferencia de datos personales. Toda\r\ntransmisión, suministro o manifestación de datos personales, de carácter\r\nnacional o internacional, a una persona jurídica de derecho privado, a una\r\nentidad pública o a una persona natural distinta del titular de datos\r\npersonales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.8. Tratamiento de datos personales. Cualquier\r\noperación o procedimiento técnico, automatizado o no, que permite la recopilación,\r\nregistro, organización, almacenamiento, conservación, elaboración,\r\nmodificación, extracción, consulta, utilización, bloqueo, supresión,\r\ncomunicación por transferencia o por difusión o cualquier otra forma de\r\nprocesamiento que facilite el acceso, correlación o interconexión de los datos\r\npersonales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.9. Derechos Arco. Derechos que ostenta toda persona\r\nnatural en cuanto titular de datos personales.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.10. Solicitud de ejercicio de Derecho ARCO. Es el\r\npedido de acceso, rectificación, actualización, inclusión, cancelación,\r\nsupresión u oposición, que formula el titular de datos personales respecto a su\r\ninformación.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 22.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"ES\" style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#212121;mso-ansi-language:ES;\r\nmso-fareast-language:RU\">1.11. Consentimiento del interesado: es toda\r\nmanifestación de voluntad libre, específica, informada e inequívoca por la que\r\nel interesado acepta, ya sea mediante una declaración o una clara acción\r\nafirmativa, el tratamiento de datos personales que le conciernen<o:p></o:p></span></p>', NULL, NULL, NULL, NULL, 1, 1, 1, '2021-02-16 11:30:36', '2021-02-24 11:29:54', NULL);
